import math

for record in sdc.records:
  try:
    record.value['is_prime'] = True
    number = math.fabs(record.value["number"])

    if number == 0 or number == 1:
       record.value['is_prime'] = False
    elif number % 2 == 0: 
      record.value['is_prime'] = False
    else:
      for i in range(3, int(math.floor(math.sqrt(number)))):
        if (i % 2 != 0):
          if number % i == 0:
             record.value['is_prime'] = False
    sdc.output.write(record)

  except Exception as e:
    sdc.error.write(record, str(e))

